o contest the Show Cause Notice Dated 06.05.2019 issued by NEPRA Islamabad for imposing for fine on NTDC amounting to One Hundred Million Rupees (100,000,000)','','1667','Show Cause Notice','2019-06-05',1,0,'local','NEPRA issued Show Cause Notice dated 06.05.2019 under Rule 4(8) & (9) of the NEPRA (Fines) Rules-2002 and asked NTDC to show cause against imposition of fine of                     Rs. 100,000,000 for allegedly violating the provisions of law arising out of grid code, 2015 and to ensure minimum cost generation despatch','NTDC approached NEPRA authorities to withdraw the impugn show cause notice and revisit the proposed fine imposed upon company'),(735,'',8,136,84,3,'','FILING OF APPLICATION BEFORE EXECUTING COURT FOR MODIFYING & CLARIFYING ORDERS DATED 30.10.2018 IN THE CASE TITLED IMAM DIN & SARDAR KHAN LAND OWNERS ETC VS NTDC ETC','','384','APPLICATION','1970-01-01',1,0,'local','Wapda acquired land for construction of 220/500KV G/S Rawat near Islamabad during 1988 and compensation was paid to the land owners. Some land owners filed reference before civil judge Rawalpindi for enhancement of cost of land, which was decided in their favor on 22.09.1992. Execution petition filed by Mr. Imam Din & Sardar Khan for implementation of court order is pending before Senior Civil Judge Rawalpindi','Prayed the court to pass an appropriate order for implementation of judgment/decree and payment of enhanced compensation with entrust.'),(736,'',11,56,1,29,'','WP NO. 47854/2019 FILED BY M/S ASIF & SONS VS. NTDC','','1706','WP NO. 47854/2019','2019-09-12',1,0,'local','',''),(737,'',30,214,53,3,'','REFERENCE AGAINST AWARD NO.77/LACP DATED:17.01.2017 FILED BY MR. MUHAMMAD RAFIQUE LAND OWNER VS NTDC ADDITIONAL DISTT. & SESSION JUDGE-I NOWSHEHRA.','','1693','AWARD NO.77/LACP','2019-07-15',1,0,'local','',''),(738,'',30,215,141,194,'','APPEAL FILED BY WAJID MEHMOOD VS. NTDC AGAINST ORDER DATED: 12.07.2019 PASSED BY CIVIL JUDGE 1ST CLASS JHELUM','','1681','APPEAL','2019-09-17'