/*Table structure for table `hearings` */

DROP TABLE IF EXISTS `hearings`;

CREATE TABLE `hearings` (
  `HearingId` int(11) NOT NULL AUTO_INCREMENT,
  `CaseId` int(100) NOT NULL,
  `IsCaseDisposedOff` int(11) NOT NULL,
  `HearingDate` date NOT NULL,
  `NextHearingDate` date NOT NULL,
  `Proceedings` longtext NOT NULL,
  `HearingStatusId` int(11) NOT NULL,
  `FinalBriefRemarksOfCase` int(11) NOT NULL,
  `RecordStatus` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`HearingId`)
) ENGINE=InnoDB AUTO_INCREMENT=651 DEFAULT CHARSET=latin1;

